import React, { useState, useEffect } from 'react';

export default function App() {
  const [step, setStep] = useState(1); // 1: Tally Form, 2: Plan Selection, 3: Checkout
  const [selectedPlan, setSelectedPlan] = useState(null);
  const [error, setError] = useState('');

  const plans = [
    {
      id: 'starter',
      name: 'Starter',
      price: '$492',
      description: 'Perfect for small teams',
      features: ['100,000 contact exports', 'Basic contact information', 'Email support']
    },
    {
      id: 'professional',
      name: 'Professional',
      price: '$769',
      description: 'For growing businesses',
      features: ['1,000,000 contact exports', 'Advanced contact information', 'Priority support', 'API access']
    },
    {
      id: 'enterprise',
      name: 'Enterprise',
      price: '$1.5K',
      description: 'For large organizations',
      features: ['Unlimited contact exports', 'All contact information', '24/7 support', 'API access', 'Custom integrations']
    }
  ];

  useEffect(() => {
    // Load Tally script
    const script = document.createElement('script');
    script.src = 'https://tally.so/widgets/embed.js';
    script.async = true;
    document.head.appendChild(script);

    // Listen for Tally form submission
    window.addEventListener('message', (event) => {
      if (event.data.type === 'tally:formSubmitted') {
        setStep(2); // Move to plan selection after form submission
      }
    });

    return () => {
      document.head.removeChild(script);
    };
  }, []);

  const handlePlanSelect = (planId) => {
    setSelectedPlan(planId);
    setStep(3);
  };

  const handleCheckout = (e) => {
    e.preventDefault();

    // Track conversion
    if (window.gtag_report_conversion) {
      window.gtag_report_conversion();
    }

    // Track form submission
    if (window.gtag) {
      window.gtag('event', 'conversion', {
        'send_to': 'AW-16975807809/nu3ECIjLz7MaEMGK2Z4_',
        'value': 1.0,
        'currency': 'USD',
        'transaction_id': '',
        'plan_type': selectedPlan
      });
    }

    // Show error message (simulating payment failure)
    setError('Uh oh, something went wrong. Please try again later.');
  };

  return (
    <div className="bg-white">
      <header className="absolute inset-x-0 top-0 z-50">
        <nav className="flex items-center justify-center p-6 lg:px-8" aria-label="Global">
          <div className="flex">
            <a href="/" className="-m-1.5 p-1.5">
              <span className="text-2xl font-bold text-black">🏥 Medical Provider Leads</span>
            </a>
          </div>
        </nav>
      </header>

      <div className="relative isolate pt-14">
        <div className="absolute inset-x-0 -top-40 -z-10 transform-gpu overflow-hidden blur-3xl sm:-top-80">
          <div
            className="relative left-[calc(50%-11rem)] aspect-[1155/678] w-[36.125rem] -translate-x-1/2 rotate-[30deg] bg-gradient-to-tr from-primary-200 to-primary-400 opacity-30 sm:left-[calc(50%-30rem)] sm:w-[72.1875rem]"
            style={{
              clipPath:
                'polygon(74.1% 44.1%, 100% 61.6%, 97.5% 26.9%, 85.5% 0.1%, 80.7% 2%, 72.5% 32.5%, 60.2% 62.4%, 52.4% 68.1%, 47.5% 58.3%, 45.2% 34.5%, 27.5% 76.7%, 0.1% 64.9%, 17.9% 100%, 27.6% 76.8%, 76.1% 97.7%, 74.1% 44.1%)',
            }}
          />
        </div>

        <div className="mx-auto max-w-7xl px-6 py-24 sm:py-32 lg:px-8">
          {step === 1 && (
            <div className="mx-auto max-w-2xl text-center">
              <h1 className="text-4xl font-bold tracking-tight text-gray-900 sm:text-6xl">
                Get Started with Medical Provider Leads
              </h1>
              <p className="mt-6 text-lg leading-8 text-gray-600">
                Enter your information to begin your free trial
              </p>
              <div className="mt-10">
                <iframe 
                  data-tally-src="https://tally.so/embed/w7EY0R?alignLeft=1&hideTitle=1&transparentBackground=1&dynamicHeight=1" 
                  loading="lazy" 
                  width="100%" 
                  height="364" 
                  frameborder="0" 
                  marginheight="0" 
                  marginwidth="0" 
                  title="MedicalProviderLeads"
                ></iframe>
              </div>
            </div>
          )}

          {step === 2 && (
            <div className="mx-auto max-w-2xl text-center">
              <h2 className="text-3xl font-bold tracking-tight text-gray-900 sm:text-4xl">
                Choose Your Plan
              </h2>
              <div className="mt-10 grid grid-cols-1 gap-8 sm:grid-cols-3">
                {plans.map((plan) => (
                  <div
                    key={plan.id}
                    className={`rounded-lg border p-6 cursor-pointer transition-all duration-200 ${
                      selectedPlan === plan.id
                        ? 'border-primary-600 bg-primary-50'
                        : 'border-gray-200 hover:border-primary-600'
                    }`}
                    onClick={() => handlePlanSelect(plan.id)}
                  >
                    <h3 className="text-lg font-semibold text-gray-900">{plan.name}</h3>
                    <p className="mt-2 text-3xl font-bold text-gray-900">{plan.price}</p>
                    <p className="mt-2 text-sm text-gray-600">{plan.description}</p>
                    <ul className="mt-4 space-y-2">
                      {plan.features.map((feature) => (
                        <li key={feature} className="flex items-center text-sm text-gray-600">
                          <svg className="h-5 w-5 text-primary-600 mr-2" viewBox="0 0 20 20" fill="currentColor">
                            <path fillRule="evenodd" d="M16.707 5.293a1 1 0 010 1.414l-8 8a1 1 0 01-1.414 0l-4-4a1 1 0 011.414-1.414L8 12.586l7.293-7.293a1 1 0 011.414 0z" clipRule="evenodd" />
                          </svg>
                          {feature}
                        </li>
                      ))}
                    </ul>
                  </div>
                ))}
              </div>
            </div>
          )}

          {step === 3 && (
            <div className="mx-auto max-w-2xl text-center">
              <h2 className="text-3xl font-bold tracking-tight text-gray-900 sm:text-4xl">
                Start Your Trial
              </h2>
              <div className="mt-10">
                <div className="rounded-lg border border-gray-200 p-6">
                  <h3 className="text-lg font-semibold text-gray-900">
                    {plans.find(p => p.id === selectedPlan)?.name} Plan
                  </h3>
                  <p className="mt-2 text-3xl font-bold text-gray-900">
                    {plans.find(p => p.id === selectedPlan)?.price}
                  </p>
                  <form onSubmit={handleCheckout} className="mt-6">
                    <button
                      type="submit"
                      className="w-full rounded-md bg-primary-600 px-3.5 py-2.5 text-sm font-semibold text-white shadow-sm hover:bg-primary-500 focus-visible:outline focus-visible:outline-2 focus-visible:outline-offset-2 focus-visible:outline-primary-600"
                    >
                      Start Trial
                    </button>
                  </form>
                  {error && <p className="mt-4 text-sm text-red-600">{error}</p>}
                </div>
              </div>
            </div>
          )}
        </div>

        <div className="absolute inset-x-0 top-[calc(100%-13rem)] -z-10 transform-gpu overflow-hidden blur-3xl sm:top-[calc(100%-30rem)]">
          <div
            className="relative left-[calc(50%+3rem)] aspect-[1155/678] w-[36.125rem] -translate-x-1/2 bg-gradient-to-tr from-primary-200 to-primary-400 opacity-30 sm:left-[calc(50%+36rem)] sm:w-[72.1875rem]"
            style={{
              clipPath:
                'polygon(74.1% 44.1%, 100% 61.6%, 97.5% 26.9%, 85.5% 0.1%, 80.7% 2%, 72.5% 32.5%, 60.2% 62.4%, 52.4% 68.1%, 47.5% 58.3%, 45.2% 34.5%, 27.5% 76.7%, 0.1% 64.9%, 17.9% 100%, 27.6% 76.8%, 76.1% 97.7%, 74.1% 44.1%)',
            }}
          />
        </div>
      </div>

      <footer className="mx-auto mt-32 max-w-7xl px-6 pb-8 sm:mt-56 lg:px-8">
        <div className="mt-16 border-t border-gray-900/10 pt-8 sm:mt-20 lg:mt-24">
          <p className="text-xs leading-5 text-gray-500">
            &copy; 2024 Provider Intelligence. All rights reserved.
          </p>
        </div>
      </footer>
    </div>
  );
}
